import React from "react";
import "./App.css";
import ReactDOM from "react-dom/client";

import "./i18n";


import Header from './layout/Header'
import LocationDateForm from './components/LocationDateForm'
import Footer from './layout/Footer'

import SunriseChart from './components/SunriseChart';

const result = [
  {
    location: { name: "Paran치", country: "Brazil" },
    date: "2025-05-11",
    sunrise: "2025-05-23T06:55:00.000Z",
    golden_hour: "2025-05-23T17:22:44.000Z",
    sunset: "2025-05-23T17:54:55.000Z"
  },
  {
    location: { name: "Paran치", country: "Argentina" },
    date: "2025-05-11",
    sunrise: "2025-05-23T07:19:22.000Z",
    golden_hour: "2025-05-23T17:36:37.000Z",
    sunset: "2025-05-23T18:09:48.000Z"
  }
];

export default function App() {
    return ( 
        <div className="App">
            <Header />
            <div className="min-h-screen bg-gray-50 p-8">
                <h1 className="text-2xl font-bold mb-6">Search Data</h1>
                <LocationDateForm />

                {result && (
                    <div className="mt-8">
                        <SunriseChart result={result} />
                    </div>
                )}
            </div>
            <Footer />
        </div>
    )
}

const root = ReactDOM.createRoot(document.getElementById("root"))
root.render(<App />)
